/* global chrome */

import React from 'react';
import ReactDOM from 'react-dom';
import { MLDataProvider } from '../contexts/MLDataContexts';
import { SidebarPagesProvider } from '../contexts/Pages';
import Popups from '../Popups';
import DocsDOM from '../helpers/DocsDOM';
import DOM from '../helpers/DOM';

const injectComponents = () => {
  ('injecting');
  const LocabComponents = document.createElement('div');
  LocabComponents.id = 'Locab';
  document.body.appendChild(LocabComponents);
  ReactDOM.render(
    <SidebarPagesProvider>
      <MLDataProvider>
        <Popups />
      </MLDataProvider>
    </SidebarPagesProvider>,
    LocabComponents
  );
  const LocabHighlightsDiv = document.createElement('div');
  LocabHighlightsDiv.id = 'Locab-Highlights-Div';
  const LocabDiv = document.createElement('div');
  LocabDiv.id = 'Locab-Div';
  const LocabDiv2 = document.createElement('div');
  const LocabDiv3 = document.createElement('div');
  LocabDiv2.id = 'Locab-Div-2';
  LocabDiv3.id = 'Locab-Div-3';
  LocabDiv2.appendChild(LocabDiv3);
  LocabDiv.appendChild(LocabDiv2);
  LocabHighlightsDiv.appendChild(LocabDiv);
  document
    .querySelector('.kix-appview-editor')
    .firstChild.appendChild(LocabHighlightsDiv);
};

// const injectedCode = `(function() {window[‚Äò_docs_annotate_canvas_by_ext‚Äô] = '${chrome.runtime.id}';})();`;

// const script = document.createElement('script');

// script.textContent = injectedCode;

// (document.head || document.documentElement).appendChild(script);

// script.remove();

setTimeout(() => {
  DocsDOM.setSidebar('open');
  injectComponents();
  document.getElementById('kix-current-user-cursor-caret').style.pointerEvents =
    'none';
  DOM.clickListener();
  DOM.hoverListener();
  DOM.hoverOffListener();
  DocsDOM.removeDocsOverlay();
}, 1000);

{
  "manifest_version": 3,
  "version": "0.0.1",
  "short_name": "Locabify",
  "name": "Locabify",
  "description": "Chrome extension which allows companies to get feedback on their writing and localize stuff.",
  "homepage_url": "https://path/to/homepage",
  "action": {
    "default_title": "Locabify",
    "default_popup": "popup.html",
    "default_icon": "logo.png"
  },
  "background": {
    "service_worker": "background.bundle.js"
  },
  "options_page": "options.html",
  "icons": {
    "16": "img/icon-16.png",
    "48": "img/icon-48.png",
    "128": "img/icon-128.png"
  },
  "permissions": [
    "activeTab",
    "scripting",
    "proxy",
    "storage",
    "browsingData",
    "notifications"
  ],
  "content_scripts": [
    {
      "js": ["contentScript.bundle.js"],
      "matches": ["http://*/", "https://*/"],
      "run_at": "document_start"
    }
  ],
  "host_permissions": ["http://*/", "https://*/"],
  "content_security_policy": {
    "extension_pages": "script-src 'self'; object-src 'self'"
  },
  "web_accessible_resources": [
    {
      "resources": ["../src/Popups.css"],
      "matches": ["<all_urls>"]
    }
  ]
}
